#
# Does not work for last test case.
#
from typing import List
from collections import Counter

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        def partition(val, arr):
            #print(f'\tval, arr = {val}, {arr}')
            if val == 0:
                self.min_val = min(self.min_val, len(arr))
                return
            if val == 1:
                return
            for n in [3, 2]:
                if val - n >= 0:
                    partition(val-n, arr+[n])
        cntr = Counter(nums)
        cnt = 0
        for _, v in cntr.items():
            self.min_val = float('inf')
            partition(v, [])
            cnt += self.min_val
        return cnt

